import "./contentItem.css";
const ContentItem = (props) => {
  console.log(props);
  return (
    <div className="itemSearch d-flex">
      <div className="itemSearch__image">
        <img src={props.img_url} alt="" />
      </div>
      <div className="itemSearch__description"></div>
      <div className="itemSearch__review"></div>
    </div>
  );
};
export default ContentItem;
